import useStyles from './SidebarStyles';
import {Paper, Typography} from '@material-ui/core'

const Sidebar = () => {

    const classes = useStyles();

    return (
        <Paper className={classes.sidebar}>
            <Typography variant="h4">Dashboard</Typography>
            <hr />
        </Paper>
    )
}

export default Sidebar
